import "./App.css";
import Login from "./pages/Login";
import Home from "./pages/Home";
import Signup from "./pages/Signup";
import { Navigate,Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
      <Route path="/" elment={<Navigate to="/login"/>} />
        <Route path="/login" elment={<Login />} />
        <Route path="/signup" elment={<Signup />} />
        <Route path="/home" elment={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
